import React from 'react'
 
export default function Header(args){
    return(
        <div className="header">
            <div><p className='logo'>LogoName</p></div>
            <div>
                {args.headers.map(headers => {
                    return ( <a href={headers.link}>{headers.title}</a> )
                })}
            </div>
        </div>
    )
}
